Keys for Kaspersky 22.07.2014

Interface language - Russian!!!

1) choose &quot;Enter licence code&quot;
2) We see 2 bottoms, click &quot;Activate program&quot;
3) Disconnect internet. Copy In the input line 22222-22222-22222-2222U. Click &quot;Next&quot;.
4) Now we see a function &quot;to activate using the key&quot;
5) Click &quot;Browse&quot; and select the key for KIS2013 
6) Before you install a new key, delete the old one!
